import React from 'react';
import './App.css';
import Who from './parts/who.js';
import Goals from './parts/goals.js';
import Journey from './parts/journey.js';
import Todo from './parts/todo.js';
import {
    BrowserRouter as Router,
    Route, Link, Redirect, withRouter
  } from 'react-router-dom';


  const App = () => {

    const padding = { padding: 5 }

    return (
      <div>
        <Router>
          <div>
            <div>
              <Link style={padding} to="/">Who?</Link>
              <Link style={padding} to="/goals">Goals</Link>
              <Link style={padding} to="/journey"><h2 className = 'Port-link'>Journey</h2></Link>
              <Link style={padding} to="/todo"> <h2 className = 'Port-link'>TODO</h2></Link>
            </div>
            <Route exact path="/" render={() => <Who />} />
            <Route path="/goals" render={() => <Goals />} />
            <Route path="/journey" render={() => <Journey />} />
            <Route path="/todo" render={() => <Todo />} />
          </div>
        </Router>
      </div>
    )
  }

export default App;
